import React, { useEffect, useState } from 'react';
import { useLocation } from 'react-router-dom';
import s from './Simulacion.module.css';
import Header from './components/Header/Header';

function Simulacion() {

  const SimulacionComponent = () => {
    const location = useLocation();
    const [datosSimulacion, setDatosSimulacion] = useState(null);

    useEffect(() => {
      // Obtener el valor del parámetro 'datosSimulacion' de la URL
      const datosSimulacionString = new URLSearchParams(location.search).get('datosSimulacion');

      if (datosSimulacionString) {
        // Decodificar la cadena JSON y establecer en el estado
        const datos = JSON.parse(decodeURIComponent(datosSimulacionString));
        setDatosSimulacion(datos);
      }
    }, [location.search]);
    console.log(datosSimulacion)
  };

  return (
    <>
    <Header />
    <article className={s.wrapper}>
      <h1>Simulación del préstamo</h1>
      <div className={s.box}>
      <div className={s.table}>
        <div className={s.infos}>
          <div className={s.info}>
            <text className={s.rotulo}>Nombres:</text>
            <span>Hola</span>
          </div>
          <div className={s.info}>
            <tex className={s.rotulo}>Teléfono:</tex>
            <text>+56 9 1234 5678</text>
          </div>
          <div className={s.info}>
            <tex className={s.rotulo}>Monto en UF:</tex>
            <text>1000</text>
          </div>
          <div className={s.info}>
            <tex className={s.rotulo}>Tasa de interés:</tex>
            <text>5%</text>
          </div>
        </div>
        <div className={s.infos}>
          <div className={s.info}>
            <text className={s.rotulo}>Apellidos:</text>
            <text>Gonzalez Torres</text>
          </div>
          <div className={s.info}>
            <tex className={s.rotulo}>Email:</tex>
            <text>mariagonzalez@example.com</text>
          </div>
          <div className={s.info}>
            <tex className={s.rotulo}>Valor de la cuota en UF:</tex>
            <text>87,5</text>
          </div>
          <div className={s.info}>
            <tex className={s.rotulo}>Cantidad de cuotas:</tex>
            <text>12</text>
          </div>
        </div>
      </div>
      <div className={s.buttons}>
        <button className={s.button}>Volver</button>
        <button className={s.button}>Descargar</button>
      </div>
      </div>
    </article>
    </>

  );
}

export default Simulacion;
